import React from 'react'
import { image } from '../../shared/image'

const Dashboard = () => {
    return (
        <div>
            <img src={image.Banner} width="100%" height={300} />
            <img src={image.UserAvatar} alt="User Avatar" />
        </div>
    )
}

export default Dashboard
